var maker = 'Audi';
var model = 'A3';
cy.fillSearchInput(_selectorsData.data.dealershipsData.city);
cy.waitForSearchResults();
cy.chooseMakerAndModel(maker, model);
cy.waitForSearchResults();
cy.contains('.filter-outer', 'Year').click();
cy.get('.year-filter-container').within(function () {
  cy.get('.noUi-handle').eq(0).click().type('{rightarrow}'.repeat(12)).click();
  cy.wait(200);
  cy.get('#slider-snap-value-lower').should('contain', '2018').parents('.content-container').within(function () {
    cy.clickBtn('Save');
  });
});
cy.waitForSearchResults();
cy.get('[dtmintersectionobserverlist]').eq(0).within(function () {
  cy.get('.content-clickable').each(function () {
    cy.get('[itemprop="manufacturer"]').should('contain', maker);
    cy.get('[itemprop="model"]').should('contain', model);
    cy.get('[itemprop="releaseDate"]').then(function (value) {
      var year = parseInt(value.text(), 10);
      expect(year).above(2017);
    });
  });
});
